// Funkcija za preuzimanje i standardizaciju korisničkih podataka
export const fetchUserData = async (userId) => {
  try {
    const response = await fetch(`http://your-api-endpoint.com/userData/${userId}`);
    if (!response.ok) {
      throw new Error('Failed to fetch user data');
    }
    const data = await response.json();
    return standardizeUserData(data);  // Standardizacija podataka
  } catch (error) {
    console.error("Error fetching user data", error);
    return null;
  }
};
